import React from "react";
import '../'

const Title = ({ subtitle, title }) => {
  return (
    <>
      <div>
        <div id="heading">
          <h2>{subtitle}</h2>
          <h1>{title}</h1>
        </div>
      </div>
    </>
  );
};
export default Title;
